// ==/UserScript==

(function () {
  "use strict";
  const style = `
#relacibo-custom-style-toggle-button {
  font-size: 2rem;
  cursor: pointer;
  position: fixed;
  bottom: 1rem;
  left: 1rem;
  opacity: 0.3;
}

#relacibo-custom-style-toggle-button:hover {
  opacity: 1;
}
`;

  let styleElement = document.createElement("style");
  document.body.appendChild(styleElement);
  styleElement.innerHTML = style;

  let toggleButton = document.createElement("div");
  toggleButton.setAttribute("id", "relacibo-custom-style-toggle-button");
  document.body.appendChild(toggleButton);

  let friendBox = document.getElementById("friend_box");

  let showStr = localStorage.getItem("relacibo.custom-style.show-top-bar");
  let show = !showStr || showStr === "true";

  const toggleShow = () => {
    show = !show;
    setShow(show);
  };

  const setShow = (doShow) => {
    show = doShow;
    localStorage.setItem("relacibo.custom-style.show-top-bar", show.toString());
    updateStyle(show);
  };

  function updateStyle(gamemode) {
    let topBar = document.getElementById("top");
    if (gamemode) {
      topBar.style.display = "none";
      toggleButton.setAttribute("data-icon", "♔");
      document.body.style.setProperty("--zoom", "108");
      document.body.style.overflow = "hidden";
      window.scrollTo(0, 0);
      friendBox.style.display = "none";
      // if (!document.fullscreenElement) {
      //  document.documentElement.requestFullscreen();
      // }
    } else {
      topBar.style.display = "flex";
      toggleButton.setAttribute("data-icon", "♚");
      document.body.style.setProperty("--zoom", "100");
      document.body.style.overflow = "auto";
      friendBox.style.display = "block";
      // if (document.fullscreenElement) {
      //   document.exitFullscreen();
      // }
    }
  }

  updateStyle(show);
  toggleButton.addEventListener("click", function () {
    toggleShow();
  });

  addEventListener("fullscreenchange", (event) => {
    if (!document.fullscreenElement) {
      setShow(false);
    }
  });

  window.addEventListener("load", function () {
    let resize = document.getElementsByTagName("cg-resize").item(0);
    if (resize) {
      resize.style.display = "none";
    }
  });

  let addAnarchyStyle = () => {
    const anarchyStyle = `
    .is2d .black.bishop {
      background-image: url("data:image/svg+xml;base64,");
    }

    .is2d .white.bishop {
      background-image: url("data:image/svg+xml;base64,");
    }
    `;

      let anarchyStyleElement = document.createElement("style");
      document.body.appendChild(anarchyStyleElement);
      anarchyStyleElement.innerHTML = anarchyStyle;
  };

  if (document.body.dataset.pieceSet === 'anarcandy') { addAnarchyStyle(); }

})();
